import React from 'react'
import Tweet from './Tweet'

class Tweets extends React.Component{

    render(){
        return(
            <div className="display">
                <div class="panel-body msg_container_base">
                    {
                        this.props.tweets.map(t => {
                            return(

                                    <Tweet tweet={t}/>

                            )
                        })
                    }
                </div>
            </div>
        );
    }
}

export default Tweets;
